import { FaAward, FaStar, FaHeart, FaDownload } from "react-icons/fa";

export default {
  wallet: [
    {
      count: 200,
      suffixText: "M+",
      body: "Users",
    },
    {
      count: 200,
      suffixText: "+",
      body: "Companies",
    },
    {
      count: 120,
      suffixText: "M+",
      body: "Dollars",
    },
  ],
};
